import { Grid, Typography } from "@mui/material";
import { Container } from "@mui/material/Container";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";


const MusicList = () => {
  return (
    <>
      <Container>
        <Grid container>
          <Grid xs={4}>
            <Typography variant="h1" component="h2">
              Sakambari
            </Typography>;

          </Grid>

        </Grid>
      </Container>
    </>
  )
}
export default MusicList;
